/*

    Is used to generate a new report for the user

    Will need to use the input to send to the backend, possibly redirect to another component

    @Notes: Lyka Marcelino, 04/09/2020

 */
import React from 'react';
import {Button} from 'react-bootstrap';
import graphForm from "../components/graphForm";
import {BrowserRouter as Router, Link, Route} from "react-router-dom";
import Sales from "../components/Sales";
import Invoices from "../components/Invoices";
import Estimates from "../components/Estimates";

const dataRoute = [
    { path: '/sales',
        main: () =>  <Sales/>
    },
    { path: '/invoices',
        main: () => <Invoices/>
    },
    {
        path: '/estimates',
        main: () => <Estimates/>
    }
]

export const NewReport = (props) => (
    <>
        <div style={{marginLeft: '170px',marginTop: '0px',fontSize: '2rem', fontWeight: 'bold'}}>View your QuickBooks Data</div>
        <Router>
            <div style={{marginLeft: '170px', marginTop:'10px'}}>
                <ul style={{listStyleType: 'none', display:'inline'}}>
                    <Link to="/sales" style={{marginRight: '10px'}}>
                        <Button variant="outline-secondary">Sales</Button>{' '}
                    </Link>
                    <Link to="/invoices" style={{marginRight: '10px'}}>
                        <Button variant="outline-secondary">Invoices</Button>{' '}
                    </Link>
                    <Link to="/estimates">
                        <Button variant="outline-secondary">Estimates</Button>{' '}
                    </Link>
                </ul>
                <div>
                    {dataRoute.map((route) => (
                        <Route
                            key={route.path}
                            path={route.path}
                            exact={route.exact}
                            component={route.main}
                        />
                    ))}
                </div>
            </div>
        </Router>

    </>
)
